        $scope.actsLocs = response.actsLocs;
        $scope.activities = response.activities;
        $scope.locations = response.locations;
        $scope.params = response.params;
        // Partial success
        if (response.errorMessage) {
          dfd.reject({
            message: response.errorMessage,
            code: 500
          });
        } else {
          // Fully successful
          dfd.resolve();
        }
